import React, {useState} from 'react'
import './functions.css'

const SellShare = (props) => {
    //props
    const shares = props.shares
    const team = props.team
    const user = props.user

    //states
    const [calc, setCalc] = useState('')

    //Functionality
    //calc add digit
    const addDigit = (e) => {
        let hold = calc
        hold.concat(e.target.value.toString())
        console.log(hold)
    }

    return(
        <div className="TradePopup">
            <div className="SellShare">
                <div className="ss-title">Sell</div>
                <div className='ss-shares'>sim{team.team} : {shares} shares </div>
                <div><button onClick={addDigit} value='1'>1</button><button onClick={addDigit} value="2">2</button></div>
            </div> 
        </div>
    )
}

export default SellShare
